import ProfilePic from './Left/ProfilePic'
import data from '../data/data.json'
export default function Left() {
    return (
        <div>
            <ProfilePic />
            <br />
            <span>{data.name}</span>
            <div>
                <strong>Top Skills *</strong>
                {data.skills.topskill.map((TopSkil: string) => {
                    return <span>{TopSkil}</span>
                })}
            </div>

        </div>
    )
}
